function App() {
  const [index, setIndex] = useState(0);
  const [showMore, setShowMore] = useState(false);

  function handleNextClick() {
    setIndex(index + 1);
  }

  function handleMoreClick() {
    setShowMore(!showMore);
  }

  return (
    <>
    <body style={{
      backgroundColor: 'rgb(255, 227, 194)'
    }}>
      <h1 style={{
        color:'rgb(32, 5, 153)',
        textAlign:'center',
        fontSize: '200%',
        fontFamily:'comic sans ms',
      }}>Let's get some Kanye Quotes!</h1>

      <p style={{
        textAlign:'center'
      }}>
        <img
          src='https://kanye-app-solutions.vercel.app/static/media/kanye-west-kanye.39657b72.gif'
          alt='Kanye West gif'
          style={{
            width:'70%',
            height:'70%',
            borderRadius: '3%'
          }}
        />
      </p>
    </body>
    </>
  );
}

export default App;
